INSERT INTO `qna` VALUES (1,'ssafy','김싸피','요즘 핫한 지역 질문드립니다.','요즘에 핫한 지역 어디일까요...?\n부동산 초보입니다 ㅠㅠ\n잘 아시는 분들 정보 공유 부탁드립니다..!!',0,'2021-05-25 22:03:38'),(2,'bangssafy','방싸피','좋은 매물 알고 계시면 알려주세요~!','혹시 좋은 정보 있으면 알려주세요\n감사합니다~',0,'2021-05-26 06:30:16'),(3,'jossafy','조싸피','관리자님 요청사항 있습니다.','아파트 주변 카페 정보도 같이 제공해 주면 좋을 것 같아요!\n\n제가 별다방 좋아하는데 별다방 근처 집 구하고 싶어요...ㅎㅎ\n지금도 주차 정보 제공해줘서 좋지만\n카페 정보도 같이 제공해 주면 좋을 것 같습니다!\n\n그럼 좋은 하루 되세요~!',0,'2021-05-26 06:37:40');
