INSERT INTO `article` VALUES (11,'관리자','[필독] 이용 안내','저희 Happy House는 사용자가 원하는 정보를 빠르고 정확하게 전달하기 위해 최선을 다해 서비스를 제공하고 있습니다.\n\n그래서 저희 Happy House는\n1. 사용자의 관심 지역 관리하고 그 지역에 대한 정보를 제공합니다.\n관심있는 지역은 등록해 주세요. 더 많은 정보를 얻으실 수 있을 것입니다.\n2. 사용자와 소통을 하기 위한 QnA 페이지가 마련되어 있습니다.\n이용하면서 불편한 사항이나 필요한 기능이 있으시면 QnA 페이지를 통해 저희들에게 알려주세요.\n빠르게 조치를 취하도록 하겠습니다.\n\n행복한 하루 되세요~^^\n\n','2021-05-25 06:44:14'),(12,'관리자','주의사항','여러 사람이 함께 이용하는 홈페이지 입니다.\n이유 불문하고 비방 및 욕설이 포함된 게시물이 작성되면 게시판 운영 방침에 의거하여\n임의 삭제할 수 있음을 알려드리오니 참고하시기 바랍니다.','2021-05-25 06:46:40'),(13,'관리자','[5월] 안내','안녕하세요','2021-05-26 06:22:37'),(14,'관리자','[4월] 안내','안녕하세요','2021-05-26 06:22:50'),(15,'관리자','[3월] 안내','안녕하세요','2021-05-26 06:23:24');
